import Typed from 'react-typed';
import {
    Typography,
    Avatar,
    Grid,
    Box
} from "@material-ui/core";
import avatar from "../avatar.png";

const Header = () => {
  return (
    <Box>
      <Avatar src={avatar} alt= "Sari Abu-Hamad"/>
        <Typography variant="h4">
            <Typed strings= {["Sari Abu-Hamad"]} typeSpeed={40} />
        </Typography>
        <br/>
        <Typography variant="h5">
            <Typed 
            strings= {["Software Engineering", "Project Management", "Senior Analyst"]}
            typeSpeed={40} 
            backSpeed={60}
            loop
            />
        </Typography>
    </Box>

  );
};

export default Header
